<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":1058911316420443,"name":"3 Data Science - Insurance Claims","language":"python","commands":[{"version":"CommandV1","origId":1058911316420444,"guid":"617d599a-dc43-419c-a07e-e9966d038371","subtype":"command","commandType":"auto","position":1.0,"command":"%md # Insurance Claims - Fraud Detection\n**Business case:**  \nInsurance fraud is a huge problem in the industry. It's difficult to identify fraud claims. IHS is in a unique position to help the Auto Insurance industry with this problem.  \n\n**Problem Statement:**  \nData is stored in different systems and its difficult to build analytics using multiple data sources. Copying data into a single platform is time consuming.  \n\n**Business solution:**  \nUse S3 as a data lake to store different sources of data in a single platform. This allows data scientists / analysis to quickly analyze the data and generate reports to predict market trends and/or make financial decisions.  \n\n**Technical Solution:**  \nUse Databricks as a single platform to pull various sources of data from API endpoints, or batch dumps into S3 for further processing. ETL the CSV datasets into efficient Parquet formats for performant processing.  \n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1508352100757,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"8a4d2cc4-25e2-4ea5-818c-9319ec9b1eb6"},{"version":"CommandV1","origId":1058911316420445,"guid":"0ff2370a-2727-4f30-ab64-68b15672f227","subtype":"command","commandType":"auto","position":1.125,"command":"%md\nIn this example, we will be working with some auto insurance data to demonstrate how we can create a predictive model that predicts if an insurance claim is fraudulent or not. This will be a Binary Classification task, and we will be creating a Decision Tree model.\n\nWith the prediction data, we are able to estimate what our total predicted fradulent claim amount is like, and zoom into various features such as a breakdown of predicted fraud count by insured hobbies - our model's best predictor.\n      \nWe will cover the following steps to illustrate how we build a Machine Learning Pipeline:\n* Data Import\n* Data Exploration\n* Data Processing\n* Create Decision Tree Model\n* Measuring Error Rate\n* Model Tuning\n* Zooming in on Prediction Data","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1508352100880,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"4e4aebe5-3258-4eb3-88d2-613059b9879b"},{"version":"CommandV1","origId":1058911316420446,"guid":"d2e3f098-0917-4fc2-967a-c7ad5467bbf7","subtype":"command","commandType":"auto","position":1.25,"command":"%md ## Data Import\n\nFirst download [this csv file](https://raw.githubusercontent.com/jodb/sparkTestData/master/insurance_claims.csv) locally\n\nThe data used in this example was from a CSV file that was imported using the Tables UI. [Databases and Tables](https://docs.databricks.com/user-guid
